class Solution:
    def canJump(self, nums: List[int]) -> bool:
        N = len(nums)
        if N <= 1:
            return True
        j = N - 1  # smallest OK index
        for i in range(N-2, -1, -1):
            if i + nums[i] >= j:
                j = i
        return j == 0

class Solution:
    def canJump(self, nums: List[int]) -> bool:
        prev = 0
        for i in range(0,len(nums)):
            x = i + nums[i]
            if i <= prev and x > prev:
                prev = x
            if prev >= len(nums)-1:
                return True
        return False

class Solution:
    def canJump(self, nums: List[int]) -> bool:
        reachableIndex = 0
        for curr in range(len(nums)):
            if curr + nums[curr] >= reachableIndex:
                reachableIndex = curr + nums[curr]
            if curr == reachableIndex:
                break

        return reachableIndex >= len(nums) - 1

class Solution:
    def canJump(self, A:List[int])->bool:
        last = len(A)-1
        if not last:
            return True
        i   = 0
        Lim = i + A[i]
        while i < Lim:
            i += 1
            Lim = max(Lim, i+A[i])
            if Lim>=last:
                return True
        return False

