            return min_den[-1]

class Solution:
    def coinChange(self, coins: List[int], amount: int) -> int:
        MAX = float('inf')

        dp = [0] * (amount + 1)

        for i in range(1, amount + 1):
            dp[i] = min(dp[i - c] if i - c >= 0 else MAX for c in coins) + 1

        return -1 if dp[-1] == MAX else dp[-1]

class Solution:
    def coinChange(self, coins: List[int], amount: int) -> int:
        if not coins or amount <= 0:
            return 0

        coins = set(coins)
        level = [amount]
        visited = set([amount])
        count = 0
        while level:
            count += 1
            temp = []
            for a in level:
                if a in coins:
                    return count
                for c in coins:
                    if a - c > 0 and (a - c) not in visited:
                        temp.append(a - c)
                        visited.add(a - c)
            level = temp
        return -1

class Solution:
    def coinChange(self, coins: List[int], amount: int) -> int:

        dp = [float('inf') for _ in range(amount+1)]
        dp[0] = 0

        for money in range(1, amount+1):
            if money in coins:
                dp[money] = 1
            else:
                minvalue = float('inf')
                for coin in coins:
                    if money-coin > 0:
                        minvalue = min(minvalue, dp[money-coin]+1)
                dp[money] = minvalue

        return dp[amount] if dp[amount] != float('inf') else -1

