class Solution:
    def inorderTraversal(self, root:TreeNode)-> List[int]:
        res, stack = [], []
        n          = root
        #
        while n or stack:
            if not n: 
                # n.right was empty, backtrack one node (but avoid visiting the left branch again)
                n = stack.pop() 
            else:
                # n.right existed, reach its left-most node
                while n.left:
                    stack.append(n) 
                    n = n.left
            res.append(n.val)
            # Attempt to move right
            n = n.right
        return res

class Solution:
    def inorderTraversal(self, root: TreeNode) -> List[int]:
        res, stack = [], [(root, False)]
        while stack:
            node, visited = stack.pop()  # the last element
            if node:
                if visited:
                    res.append(node.val)
                else:  # inorder: left -> root -> right
                    stack.append((node.right, False))
                    stack.append((node, True))
                    stack.append((node.left, False))
        return res

class Solution:
    def inorderTraversal(self, root: TreeNode) -> List[int]:
        curr = root
        res = []
        while curr:
            if curr.left:
                pre = curr.left
                while pre.right and pre.right!=curr:
                    pre = pre.right
                if pre.right == curr:
                    pre.right = None
                    res.append(curr.val)
                    curr = curr.right
                else:
                    pre.right = curr
                    curr = curr.left
            else:
                res.append(curr.val)
                curr = curr.right
        return res

class Solution:
    def inorderTraversal(self, root: TreeNode) -> List[int]:
        output, stack =[],[]
        while(stack or root):
            if root:
                # Go to the left most and push the parent into the stack
                # We need this parent node once we are done with left child and need to go to the right child
                stack.append(root)
                root = root.left
            elif stack and root == None:
                #We are done with left , so pop out the parent
                root = stack.pop()
                output.append(root.val)
                # Go to the right child
                root = root.right
        return output

