class Solution:
    def levelOrder(self, root: TreeNode) -> List[List[int]]:
        if not root: return

        q = collections.deque([root, None]) # here, None will let you know the level
        tmp = []
        res = []
        while q:
            node = q.popleft()
            if node is None:
