class Solution:
    def numIslands(self, grid: List[List[str]]) -> int:
        total_islands = 0
        def recursive_islands(grid, m, n):
            if grid[m][n] == '0':
                return 

            grid[m][n] = '0'
            if m-1 >= 0:
