from queue import Queue

class Solution:
    def numIslands(self, grid: List[List[str]]) -> int:            
        result = 0
        for i in range(len(grid)):
            for j in range(len(grid[0])):
                if grid[i][j] == "1":
                    self.bfs(grid, i, j)
                    result += 1


        return result

    def bfs(self, grid, i, j):
        q = Queue()
        q.put([i, j])
        grid[i][j] = "#"

        while(q.qsize() > 0):
            i, j  = q.get()

            if i - 1 >= 0 and grid[i - 1][j] == "1":
                q.put([i - 1, j])
                grid[i - 1][j] = "#"

            if j - 1 >= 0 and grid[i][j - 1] == "1":
                q.put([i, j - 1])
                grid[i][j - 1] = "#"

            if i + 1 < len(grid) and grid[i + 1][j] == "1":
                q.put([i + 1, j])
                grid[i + 1][j] = "#"

            if j + 1 < len(grid[0]) and grid[i][j + 1] == "1":
                q.put([i, j + 1])
                grid[i][j + 1] = "#"

class Solution:
    def numIslands(self, grid: List[List[str]]) -> int:
        if not grid:
            return 0;

        visited = grid.copy() # in case we do not want to modify our input
        islands = 0
        stack = [] # this will simulate the call stack 

        for i in range(len(grid)):
            for j in range(len(grid[0])):
                if visited[i][j] != 'X' and grid[i][j] == '1':
                    islands += 1
                    stack.append((i, j))
					# perform dfs iteratively
                    while stack:
                        row, col = stack.pop()

                        if grid[row][col] == '1' and visited[row][col] != 'X':
                            visited[row][col] = 'X'

                        if  row + 1 < len(grid) and grid[row + 1][col] == '1':
                            stack.append((row + 1, col))
                        if  col + 1 < len(grid[0]) and grid[row][col + 1] == '1':
                            stack.append((row, col + 1))
                        if row - 1 >= 0 and grid[row - 1][col] == '1':
                            stack.append((row - 1, col))
                        if col - 1 >= 0 and grid[row][col - 1] == '1':
                            stack.append((row, col - 1))
        return islands

class Solution:

    def numIslands(self, grid: List[List[str]]) -> int:
        rows_count = len(grid)
        cols_count = len(grid[0]) if grid else 0
        num_islands = 0
        stack = []
        for i in range(rows_count):
            for j in range(cols_count):
                if grid[i][j] == '1':
                    num_islands += 1
                    stack.append((i, j))
                    while stack:
                        ci, cj = stack.pop()
                        grid[ci][cj] = '0'

                        if ci > 0 and grid[ci - 1][cj] == '1':
                            stack.append((ci - 1, cj))

                        if ci < rows_count - 1 and grid[ci + 1][cj] == '1':
                            stack.append((ci + 1, cj))

                        if cj > 0 and grid[ci][cj - 1] == '1':
                            stack.append((ci, cj - 1))

                        if cj < cols_count - 1 and grid[ci][cj + 1] == '1':
                            stack.append((ci, cj + 1))

        return num_islands

