class Solution:
    def numTrees(self, n: int) -> int:
        num = math.factorial(2*n)
        denom = math.factorial(n)*math.factorial(n+1)
        return num // denom

class Solution:
    def numTrees(self, n: int) -> int:
        dp = [0]*(n+1)
        dp[0] = 1
        for i in range(1, n+1):
            for j in range(i):
                dp[i] += dp[j] * dp[i-1-j]
