            rightSubtreeNodeCount = n - 1 - leftSubtreeNodeCount
            leftSubtrees = self.numTrees(leftSubtreeNodeCount, cache)
            rightSubtrees = self.numTrees(rightSubtreeNodeCount, cache)
            numSubtrees += leftSubtrees * rightSubtrees
