class Solution:
    def strStr(self, text: str, pat: str) -> int:
        if text==pat:
            return 0
        if pat=="":
            return 0
        def patlps(pat,lps,m):
            left=0
            i=1
            while i<m:
                if pat[left]==pat[i]:
                    left+=1
                    lps[i]=left
                    i+=1
                else:
                    if left!=0:
                        left=lps[left-1]
                    else:
                        lps[i]=0
                        i+=1
        n=len(text)
        m=len(pat)
        lps=[0]*m
        patlps(pat,lps,m)
        j=0
        i=0
        while i<n:
            if pat[j]==text[i]:
                i+=1
                j+=1
            if j==m:
                return i-j
            elif i<n and pat[j]!=text[i]:
                if j!=0:
                    j=lps[j-1]
                else:
                    i+=1
        return -1

class Solution:
    def strStr(self, text: str, pat: str) -> int:
        if pat=="":
            return 0

        con=pat+"$"+text
        left=0
        right=0
        k=0
        n=len(con)
        z=[0]*n
        for i in range(1,n):
            if right<i:
                left,right=i,i
                while right<n and con[right-left]==con[right]:
                    right+=1
                z[i]=right-left
                right-=1
            else:
                k=i-left
                if z[k]<right-i+1:
                    z[i]=z[k]
                else:
                    left=i
                    while right<n and con[right-left]==con[right]:
                        right+=1
                    z[i]=right-left
                    right-=1 
        for i in range(n):
            if z[i]==len(pat):
                return i-len(pat)-1
        return -1

class Solution:
    def strStr(self, text: str, pat: str) -> int:
        if text==pat or pat=="":
            return 0
        d=26 # no of char in input alphabet
        M=len(pat)
        N=len(text)
        if M>N:
            return -1
        q=5381 # any prime no to avoid hash collision ,greater will be effective
        i,j=0,0
        p=0 # hash value for pattern
        t=0 # hash value for text
        h=1
        # The value of h would be "pow(d, M-1)%q" 
        for i in range(M-1): 
            h = (h*d)%q 
        for i in range(M):
            p=(d*p+ord(pat[i]))%q
            t=(d*t+ord(text[i]))%q
        for i in range(N-M+1):
            if p==t:
                for j in range(M):
                    if text[i+j]!=pat[j]:
                        break
                j+=1
                if j==M:
                    return i
            if i < N-M: 
                t = (d*(t-ord(text[i])*h) + ord(text[i+M]))%q 
                if t < 0: 
                    t = t+q 
        return -1

